public StringBuilder toDebugString() {
  StringBuilder str = new StringBuilder();
  str.append("found: ").append(numFound).append('[');
  for(SearchResult r : results) {
    String id = r.document.get("id");
    str.append(id).append(", ");
  }
  str.append(']');
  return str;
}

